import React from 'react'
import CardView from './CardView'

export default function BingoCardView(props){
  // Render CardView full-screen and disable user resizing
  return (
    <div style={{width:'100vw',height:'100vh',display:'flex',alignItems:'center',justifyContent:'center',background:'rgba(6,34,58,0.95)'}}>
      <div style={{width:'100%',height:'100%',overflow:'auto'}}>
        <CardView {...props} resizable={false} />
      </div>
    </div>
  )
}
